import React from 'react';
import '../css/news.css';

const NewsCard = ({item}) => (

        <div className="card">
            <div className= "img-container">
                <a href ={item.url} target="_blank"><img className="card-img-top" src={item.urlToImage} alt={item.title} /></a>
            </div>
            <div className ="item-container">
                <a href ={item.url} target="_blank" className="card-title">{item.title}</a>
                <div class="card-source"><b>Source</b>: {item.source.name}</div>
                <a href ={item.url} target="_blank" className= "card-description">{item.description}</a>
                <div className="card-action">
                </div>
            </div>
        </div>
);

export default NewsCard;
